import React from 'react'
import "../../Css/Main.css"
import freelancer from '../../images/freelancer.png'

function Main() {
    return (
        <div className="main">
        <img class="freelancer" src={freelancer} alt="freelancer" />
        </div>
    )
}

export default Main
